import React from 'react'
import { homepage } from './Sites/homepage'
import LogIn from "./Sites/LogIn"
import {Routes, Route} from "react-router-dom"

function App () {
    return(
        <Routes>
            <Route path="/" element={<homepage />}/>
            <Route path="/LogIn" element={<LogIn />}/>
        </Routes>
    )
}

export default App;
